def sort_unique_values(dataset):
    frequency_dict = {}
    for item in dataset:
        value = item[0]
        if value not in frequency_dict:
            frequency_dict[value] += 1
        else:
            frequency_dict[value] = 1
    sorted_keys = sorted(frequency_dict.keys(), key=lambda k: (-frequency_dict[k], k))
    result = []
    for key in sorted_keys:
        result.append(key)
    return result

